import React from "react";
import { Flex, Image, Link, Text } from "rebass";
import { theme } from "../theme";
import Button from "../components/Button";
import backIcon from "../assets/backIcon.svg";
import shareIcon from "../assets/shareIcon.svg";

const ResourcesPage = () => {
  return (
    <Flex
      height="100vh"
      flexDirection="column"
      bg={theme.colors.jet}
      margin={0}
      overflow="hidden"
      maxWidth="100%"
    >
      <Flex margin={25} width="100%" flexDirection="column">
        <Link href="/">
          <Button variant="primary">
            <Image src={backIcon} height={25} width={25} marginRight="1px" />
          </Button>
        </Link>
        <Text
          fontWeight={theme.fontWeights.heading}
          lineHeight={theme.lineHeights.heading}
          fontSize={theme.fontSizes[5]}
          color={theme.colors.gainsboro}
        >
          Resources
        </Text>

        <Text
          fontWeight={theme.fontWeights.bold}
          lineHeight={theme.lineHeights.bold}
          fontSize={theme.fontSizes[4]}
          color={theme.colors.gainsboro}
          margin={1}
        >
          Blog
        </Text>

        <Text
          fontWeight={theme.fontWeights.bold}
          lineHeight={theme.lineHeights.bold}
          fontSize={theme.fontSizes[2]}
          color={theme.colors.gainsboro}
          margin={1}
        >
          2021 Kickoff ðŸŽ‰
        </Text>

        <Flex flexDirection="column">
          <Flex>
            <Text color={theme.colors.gainsboro} fontSize={theme.fontSizes[1]}>
              Author: Javier,
            </Text>
            <Text
              color={theme.colors.gainsboro}
              fontSize={theme.fontSizes[1]}
              marginLeft="5px"
            >
              {" "}
              Published: January 6th, 2021
            </Text>
          </Flex>

          <Text color={theme.colors.gainsboro} fontSize={theme.fontSizes[1]}>
            5 minute read
          </Text>
        </Flex>
      </Flex>

      <Flex marginTop={500} marginLeft={225} width="100%">
        <Button variant="accent" height={25}>
          <Image src={shareIcon} height={25} width={25} />
        </Button>
      </Flex>
    </Flex>
  );
};

export default ResourcesPage;
